import { promises as fs } from 'fs'
import path from 'path'
import { defineConfig } from 'rollup';
import { banner, terserPlugin } from './rollup-full.config.mjs'

const replacePattern = /\/\/{{START: GUI}}[\s\S]*?\/\/{{END: GUI}}/g;

/**
 * @param {string} srcFilePath
 * @param {string} dstFilePath
 */
const copyCleanedFile = async (srcFilePath, dstFilePath) => {
    if(path.extname(srcFilePath) === '.js'){
        const content = await fs.readFile(srcFilePath, 'utf8');
        const strippedFileContent = content.replaceAll(replacePattern, '');
        fs.writeFile(dstFilePath, strippedFileContent, 'utf8');
    } else {
        fs.copyFile(srcFilePath, dstFilePath);
    }
}

/**
 * https://stackoverflow.com/a/68552726
 * @param {string} src
 * @param {string} dest
 */
const copyDirectory = async (src, dest) => {
    const [entries] = await Promise.all([
        fs.readdir(src, { withFileTypes: true }),
        fs.mkdir(dest, { recursive: true }),
    ])

    await Promise.all(
        entries.map((entry) => {
            const srcPath = path.join(src, entry.name)
            const destPath = path.join(dest, entry.name)
            return entry.isDirectory()
                ? copyDirectory(srcPath, destPath)
                : copyCleanedFile(srcPath, destPath)
        })
    )
}

await copyDirectory('./src', './src_tmp');

const distDir = './dist/core'
const fileName = 'cookieconsent-core';

export default defineConfig(
    [
        {
            input: './src_tmp/index.js',
            output: [
                {
                    file: `${distDir}/${fileName}.umd.js`,
                    format: 'umd',
                    name: 'CookieConsent',
                    banner: banner
                },
                {
                    file: `${distDir}/${fileName}.esm.js`,
                    format: 'esm',
                    exports: 'named',
                    banner: banner
                }
            ],
            plugins: [
                terserPlugin
            ]
        },
    ]
);

import { defineConfig } from 'rollup';
import terser from "@rollup/plugin-terser";
import postcssCombineDuplicatedSelectors from 'postcss-combine-duplicated-selectors';
import cssnanoPlugin from 'cssnano';
import postcss from 'rollup-plugin-postcss';
import eslint from '@rollup/plugin-eslint';
import pkg from './package.json' with { type: "json"};

const srcDir = './src';
const distDir = './dist';
const cssComponentsDir = `${distDir}/css-components`;
const input = `${srcDir}/index.js`;
const productionMode = !process.env.ROLLUP_WATCH;

export const banner = `/*!
* CookieConsent ${pkg.version}
* ${pkg.repository.url}
* Author ${pkg.author}
* Released under the ${pkg.license} License
*/
`;

const cssComponents = [
    [
        'core/_base.scss',
        'base.css'
    ],
    [
        'core/components/_consent-modal.scss',
        'consent-modal.css'
    ],
    [
        'core/components/_preferences-modal.scss',
        'preferences-modal.css'
    ],
    [
        'abstracts/_dark-color-scheme.scss',
        'dark-scheme.css'
    ],
    [
        'abstracts/_light-color-scheme.scss',
        'light-scheme.css'
    ]
];

const cssComponentsRollup = cssComponents.map(component => {
    const src = `${srcDir}/scss/${component[0]}`;
    const dst = `${cssComponentsDir}/${component[1]}`

    return {
        input: src,
        output: {
            file: dst,
        },
        plugins: postcss({
            extract: true,
            plugins: [
                postcssCombineDuplicatedSelectors(),
                productionMode && cssnanoPlugin({
                    preset: ["default", {
                        discardComments: {
                            removeAll: true,
                        }
                    }]
                })
            ]
        }),
        onwarn(warning, warn) {
            if(warning.code === 'FILE_NAME_CONFLICT')
                return;
            warn(warning);
        }
    }
})

export const terserPlugin = terser({
    toplevel: true,
    format: {
        quote_style: 1,
        comments: /^!/
    },
    mangle: {
        properties: {
            regex: /^_/,
            reserved: ['__esModule', '_ccRun'],
            keep_quoted: true
        }
    },
    compress: {
        passes: 3,
        pure_funcs: [ 'debug', 'console.log']
    }
});

export default defineConfig(
    [
        {
            input: input,
            output: [
                {
                    file: pkg.main,
                    format: 'umd',
                    name: 'CookieConsent',
                    banner: banner
                },
                {
                    file: pkg.module,
                    format: "esm",
                    exports: "named",
                    banner: banner
                }
            ],
            plugins: [
                eslint({
                    fix: true,
                    include: ['./src/**'],
                    exclude: ['./src/scss/**']
                }),
                productionMode && terserPlugin,
            ]
        },
        {
            input: `${srcDir}/scss/index.scss`,
            output: {
                file: `${distDir}/cookieconsent.css`,
            },
            plugins: postcss({
                extract: true,
                plugins: [
                    postcssCombineDuplicatedSelectors(),
                    productionMode && cssnanoPlugin({
                        preset: ["default", {
                            discardComments: {
                                removeAll: true,
                            }
                        }]
                    })
                ]
            }),
            onwarn(warning, warn) {
                if(warning.code === 'FILE_NAME_CONFLICT') return;
                warn(warning);
            }
        },
        ...cssComponentsRollup
    ]
);
